## Complete Analysis Results

### 1. Did the browser send facial coordinates to an external server?

**YES** - The browser sends data to **two API endpoints**:

| Endpoint | What's Sent | What's Returned |
|----------|-------------|-----------------|
| `POST /api/side-landmarks` | JPEG image (form-data) | `rotationAngle`, `direction`, `center`, `crop`, `landmarks[]` array |
| `POST /api/faces` | Front photo (base64), side photo data | Face ID, storage URLs for images |

The server performs side profile landmark detection and returns standardized landmark coordinates.

---

### 2. MediaPipe FaceLandmarker Initialization

Found in `72b6e4a245580a73.js` (MediaPipe tasks-vision bundle):

```javascript
// FaceLandmarker class with detect methods
o1.prototype.detectForVideo = o1.prototype.F;
o1.prototype.detect = o1.prototype.D;

// Model loaded from Google Storage:
// https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task
```

---

### 3. Core Math Utilities (from `f4d39a84c2327bb4.js`)

```javascript
// Ratio calculation (division with safety checks)
let R = (value, divisor, fallback = 0) => {
    if (!isFinite(value) || !isFinite(divisor) || Math.abs(divisor) < 1e-10) 
        return fallback;
    let ratio = value / divisor;
    return isFinite(ratio) ? ratio : fallback;
};

// Euclidean distance between two points
let T = (point1, point2) => {
    let dx = point1.x - point2.x;
    let dy = point1.y - point2.y;
    return Math.max(Math.sqrt(dx * dx + dy * dy), 1e-10);
};

// Midpoint of two points
let $ = (point1, point2) => ({
    x: (point1.x + point2.x) / 2,
    y: (point1.y + point2.y) / 2
});

// Angle calculation (returns degrees)
let F = (p1, vertex, p2, p3) => {
    if (p3 === undefined) {
        // 3-point angle at vertex
        let v1 = { x: p1.x - vertex.x, y: p1.y - vertex.y };
        let v2 = { x: p2.x - vertex.x, y: p2.y - vertex.y };
        let dot = v1.x * v2.x + v1.y * v2.y;
        let mag = Math.sqrt(v1.x*v1.x + v1.y*v1.y) * Math.sqrt(v2.x*v2.x + v2.y*v2.y);
        return Math.abs(mag) < 1e-10 ? 0 : (180 / Math.PI) * Math.acos(Math.max(-1, Math.min(1, dot / mag)));
    }
    // 4-point angle between two lines
    // ... similar calculation
};
```

---

### 4. Facial Ratio Calculations (Extracted)

```javascript
const RATIO_CALCULATIONS = {
    "Midface Ratio": (landmarks) => {
        let leftPupil = landmarks.leftEyePupil;
        let rightPupil = landmarks.rightEyePupil;
        let cupidsBow = landmarks.cupidsBow;
        if (!leftPupil || !rightPupil || !cupidsBow) return null;

        let eyeWidth = Math.abs(rightPupil.x - leftPupil.x);
        let eyeCenterY = (leftPupil.y + rightPupil.y) / 2;
        return R(eyeWidth, Math.abs(cupidsBow.y - eyeCenterY));
    },

    "Eye Separation Ratio": (landmarks) => {
        let leftPupil = landmarks.leftEyePupil;
        let rightPupil = landmarks.rightEyePupil;
        let leftCheek = landmarks.leftCheek;
        let rightCheek = landmarks.rightCheek;
        if (!leftPupil || !rightPupil || !leftCheek || !rightCheek) return null;

        return 100 * R(
            Math.abs(rightPupil.x - leftPupil.x),  // eye separation
            Math.abs(rightCheek.x - leftCheek.x)   // face width
        );
    },

    "Total Facial Width to Height Ratio": (landmarks) => {
        let leftCheek = landmarks.leftCheek;
        let rightCheek = landmarks.rightCheek;
        let hairline = landmarks.hairline;
        let chinBottom = landmarks.chinBottom;
        if (!leftCheek || !rightCheek || !hairline || !chinBottom) return null;

        return R(
            Math.abs(chinBottom.y - hairline.y),   // face height
            Math.abs(rightCheek.x - leftCheek.x)   // face width
        );
    },

    "Bigonial Width": (landmarks) => {
        let leftGonion = landmarks.leftTopGonion;
        let rightGonion = landmarks.rightTopGonion;
        let leftCheek = landmarks.leftCheek;
        let rightCheek = landmarks.rightCheek;
        if (!leftGonion || !rightGonion || !leftCheek || !rightCheek) return null;

        return 100 * R(
            Math.abs(rightGonion.x - leftGonion.x),  // jaw width
            Math.abs(rightCheek.x - leftCheek.x)     // face width
        );
    },

    "Lateral Canthal Tilt": (landmarks) => {
        let leftMedial = landmarks.leftEyeMedialCanthus;
        let leftLateral = landmarks.leftEyeLateralCanthus;
        let rightMedial = landmarks.rightEyeMedialCanthus;
        let rightLateral = landmarks.rightEyeLateralCanthus;
        if (!leftMedial || !leftLateral || !rightMedial || !rightLateral) return null;

        let leftTilt = (180 / Math.PI) * Math.atan2(
            leftMedial.y - leftLateral.y, 
            leftMedial.x - leftLateral.x
        );
        let rightTilt = (180 / Math.PI) * Math.atan2(
            rightMedial.y - rightLateral.y, 
            rightLateral.x - rightMedial.x
        );
        return (leftTilt + rightTilt) / 2;
    },

    "Gonial Angle": (landmarks) => {
        let gonionTop = landmarks.gonionTop;
        let gonionBottom = landmarks.gonionBottom;
        let menton = landmarks.menton;
        let tragus = landmarks.intertragicNotch;
        if (!gonionTop || !gonionBottom || !menton || !tragus) return null;

        let angle = (180 / Math.PI) * Math.abs(
            Math.atan2(gonionTop.y - tragus.y, gonionTop.x - tragus.x) -
            Math.atan2(gonionBottom.y - menton.y, gonionBottom.x - menton.x)
        );
        return angle > 180 ? 360 - angle : angle;
    },

    "Nasolabial Angle": (landmarks) => {
        return F(landmarks.columella, landmarks.subnasale, landmarks.labraleSuperius);
    },

    "Nasofrontal Angle": (landmarks) => {
        return F(landmarks.glabella, landmarks.nasion, landmarks.supratip);
    },

    // ... 50+ more ratios
};
```

---

### 5. Score Calculation Function

```javascript
function calculateScore(value, ratioConfig, isUnlocked = false, profileType = "front") {
    // Default decay rate
    let decayRate = ratioConfig.decayRate ?? 0.2;

    // Get ideal range
    let idealMin = ratioConfig.idealMin;
    let idealMax = ratioConfig.idealMax;
    let maxScore = ratioConfig.maxScore ?? 10;
    let minScore = -maxScore;

    // Core scoring formula (exponential decay)
    let rawScore;
    if (value >= idealMin && value <= idealMax) {
        // Value is in ideal range = max score
        rawScore = maxScore;
    } else {
        // Calculate distance from ideal range
        let distance = value < idealMin ? (idealMin - value) : (value - idealMax);
        // Exponential decay from ideal
        rawScore = minScore + (maxScore - minScore) * Math.exp(-decayRate * distance);
    }

    // Normalize to 0-10 scale
    let range = maxScore - minScore;
    return Math.max(0, Math.min(10, (range > 0 ? (rawScore - minScore) / range : 0) * 10));
}
```

---

### 6. Facial Landmark Points (from `efcf865d534e303a.js`)

The code maps MediaPipe raw indices to named anatomical landmarks:

| Landmark Name | MediaPipe Index | Description |
|--------------|-----------------|-------------|
| `glabella` | 104 | Point between eyebrows |
| `nasion` | 72 | Bridge of nose |
| `pronasale` | 83 | Tip of nose |
| `subalare` | 77 | Base of nostril |
| `labraleSuperius` | 67 | Upper lip center |
| `cheilion` | 52 | Corner of mouth |
| `labraleInferius` | 59 | Lower lip center |
| `pogonion` | 24 | Chin point |
| `gonionBottom` | 2 | Jaw angle bottom |
| `cornealApex` | 40 | Eye center |

Plus derived points calculated from multiple indices (vertex, occiput, menton, etc.).

---

### Summary

The facial analysis works as follows:
1. **Client-side**: MediaPipe FaceLandmarker detects 478 facial landmarks from camera/image
2. **Server-side**: `/api/side-landmarks` processes side profile images
3. **Calculations**: JavaScript computes 50+ ratios using Euclidean distance and angle formulas
4. **Scoring**: Exponential decay function scores each ratio based on distance from ideal range

