- Values 0-50 DW ‚Üí Likely percentages or small ratios
- Values 50-200 DW ‚Üí Likely angles in degrees or scaled mm
- Values 300-800 DW ‚Üí Likely mm measurements √ó 10 or complex scaled ratios

